// src/components/Calendar.js
import React from 'react';
import './Calendar.css'; // Import the CSS for styling

const Calendar = () => {
    return (
        <div className="calendar-container">
            <div className="calendar">
                <div className="calendar-header">
                    <span className="prev">&#10094;</span>
                    <h2 className="month-year">October 2024</h2>
                    <span className="next">&#10095;</span>
                </div>
                <div className="calendar-body">
                    {/* Example days (for illustrative purposes) */}
                    {Array.from({ length: 42 }).map((_, index) => (
                        <div className="calendar-date" key={index}>
                            {index + 1}
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default Calendar;
